import {
    Grid,
    GridItem,
    Input,
    Wrap,
    Text,
    Flex,
    WrapItem,
    Textarea
} from "@chakra-ui/react"



export default function ReviewPage() {

    return (
        <div>
            <Grid h="60vw" templateRows="auto 1fr 1fr" templateColumns="repeat(1, 1fr)"
                gap={4}
                backgroundColor="primary.100">

               <Wrap>
                   <WrapItem>
                       <h1 style={{color:"white", paddingLeft:"20px"}}>Name of the movie </h1>
                       <textarea></textarea>
                   </WrapItem>
               </Wrap>

            </Grid>
        </div>
    );
}
